//Dependencies
import React from 'react';
//Internals
import './index.css';
import WomenItems from './WomenItems';

const WomensProducts = () => (
  <div className="womens-products">
    <div className="womens-title">
      <h4>Women's Items</h4>
    </div>
    <WomenItems />
  </div>
);

export default WomensProducts;
